import {useState, useEffect} from 'react';


function Form(){

    useEffect(() => {
        console.log("Use Effect Processed!");
    });

    const [email,setEmail]=useState("sourav@gmail.com");

    return(

        <div>
            <center>
            {email}
            <button onClick={()=> setEmail("souravdutta@nsec.ac.in")}>Press</button>
            </center>
            

        </div>
    )
}

export default Form
